import React from 'react'
import { NavItem } from '../nav-items/nav'
import { Icon } from '../icon'

export const Header = () => {
  return (
    <header className='flex'>
        <nav>
            <Icon />
            <NavItem />
        </nav>
    </header>
  )
}
